import styles from "./Filter.module.css";

const Filter = ({ filter }) => {
  console.log(this.filter);
  return (
    <>
      <label>
        <input
          className={styles.mainInput}
          name="filter"
          onChange={this.props.onHandleChange}
          value={this.props.filter}
        />
      </label>
    </>
  );
};

export default Filter;

